public static @NonNull SSLServerSocketFactory getServerSocketFactory(@NonNull SelfSignedKeys keys) throws GeneralSecurityException, IOException {
  Certificate certificate=CertificateFactory.getInstance(CERTIFICATE_TYPE).generateCertificate(new ByteArrayInputStream(keys.getX509Encoded()));
  KeyStore keyStore=KeyStore.getInstance(KEYSTORE_TYPE);
  keyStore.load(null);
  keyStore.setKeyEntry("client",keys.getPrivateKey(),null,new Certificate[]{certificate});
  KeyManagerFactory keyManagerFactory=KeyManagerFactory.getInstance(KeyManagerFactory.getDefaultAlgorithm());
